class Solution(object):
    def sellingWood(self, m, n, prices):
        """
        :type m: int
        :type n: int
        :type prices: List[List[int]]
        :rtype: int
        """
        def doCut(m, n):
            if m == 0 or n == 0:
                return 0

            key = str(m) + "-" + str(n)
            if key in cache:
                return cache[key]

            money = 0
            for price in prices:
                horizontal = price[0]
                vertical = price[1]
                if horizontal <= m and vertical <= n:
                    money = max(money, price[2]
                                + max(
                        doCut(horizontal, n - vertical) + doCut(m - horizontal, n),
                        doCut(m - horizontal, vertical) + doCut(m, n - vertical)))

            cache[key] = money
            return money

        # caches
        from collections import defaultdict
        cache = defaultdict(long)

        return doCut(m, n)


